<!DOCTYPE html><html><head><meta charset="utf-8"><style>
    
    @import url('https://cdn.jsdelivr.net/gh/orioncactus/pretendard@v1.3.9/dist/web/static/pretendard.min.css');
    * { margin: 0; padding: 0; box-sizing: border-box; }
    html {
        width: 1080px; height: 1080px;
        overflow: hidden;
    }
    body {
        width: 1080px; height: 1080px;
        font-family: 'Pretendard', 'Pretendard Variable', 'Malgun Gothic', 'NanumGothic', 'Noto Sans KR', sans-serif;
        background: linear-gradient(160deg, #0f1923 0%, #1B2B48 45%, #1a3a5c 100%);
        color: #FFFFFF;
        padding: 80px;
        position: relative;
        overflow: hidden;
        word-break: keep-all;
        overflow-wrap: break-word;
    }
    .accent { color: #D4AF37; }
    .gold-underline {
        text-decoration: none;
        background-image: linear-gradient(90deg, #D4AF37, #C9956B);
        background-position: 0 88%;
        background-size: 100% 6px;
        background-repeat: no-repeat;
        padding-bottom: 4px;
    }
    .gold-marker {
        background: linear-gradient(180deg, transparent 55%, rgba(212,175,55,0.25) 55%);
        padding: 0 2px;
    }
    .badge {
        display: inline-block;
        background: rgba(212,175,55,0.12);
        color: #D4AF37;
        padding: 10px 24px;
        border-radius: 8px;
        font-size: 22px;
        border: 1px solid rgba(212,175,55,0.30);
        font-weight: bold;
        letter-spacing: 1px;
        box-shadow: 0 0 20px rgba(212,175,55,0.15);
    }
    .badge::before {
        content: '◆';
        margin-right: 8px;
        font-size: 14px;
        opacity: 0.7;
    }
    .page-num {
        position: absolute; top: 50px; right: 60px;
        font-size: 18px; color: #5A7088;
        letter-spacing: 2px;
    }
    .footer {
        position: absolute; bottom: 40px; left: 80px; right: 80px;
        border-top: 1px solid rgba(255,255,255,0.06);
        padding-top: 16px;
        font-size: 16px; color: #5A7088;
    }
    .footer-flex {
        display: flex; justify-content: space-between; align-items: center;
    }
    .footer-brand {
        display: flex; align-items: center; gap: 8px;
    }
    .footer-shield {
        display: inline-block;
        width: 16px; height: 18px;
        background: linear-gradient(180deg, #D4AF37, #C9956B);
        clip-path: polygon(50% 0%, 100% 20%, 100% 70%, 50% 100%, 0% 70%, 0% 20%);
        opacity: 0.35;
    }
    .top-line {
        width: 56px; height: 4px;
        background: linear-gradient(90deg, #D4AF37, #C9956B);
        margin-bottom: 36px;
        border-radius: 2px;
    }
    .divider-line {
        height: 1px;
        background: linear-gradient(90deg, #D4AF37, transparent);
        opacity: 0.3;
    }
    .card-box {
        background: rgba(255,255,255,0.04);
        border: 1px solid rgba(212,175,55,0.10);
        border-radius: 16px;
        padding: 36px 40px;
    }
    .glass {
        background: rgba(255,255,255,0.06);
        border: 1px solid rgba(255,255,255,0.12);
        border-radius: 16px;
        backdrop-filter: blur(12px);
        -webkit-backdrop-filter: blur(12px);
    }
    .glass-chip {
        display: inline-block;
        background: rgba(255,255,255,0.06);
        border: 1px solid rgba(255,255,255,0.12);
        border-radius: 40px;
        backdrop-filter: blur(12px);
        -webkit-backdrop-filter: blur(12px);
        padding: 10px 24px;
    }
    .logo-img {
        position: absolute;
        top: 48px;
        left: 80px;
        height: 44px;
        opacity: 0.85;
    }
    .logo-img-light {
        filter: brightness(0) invert(1);
    }
    
    .dot-indicator {
        position: absolute; bottom: 78px; right: 80px;
        display: flex; gap: 8px; align-items: center; z-index: 10;
    }
    .dot {
        width: 8px; height: 8px; border-radius: 50%;
        background: #5A7088; opacity: 0.4;
        transition: all 0.3s;
    }
    .dot.active {
        width: 24px; border-radius: 4px;
        background: linear-gradient(90deg, #D4AF37, #C9956B);
        opacity: 1;
    }
    
    /* 방패 워터마크 */
    body::after {
        content: '';
        position: absolute;
        right: -40px; bottom: -40px;
        width: 360px; height: 420px;
        background: linear-gradient(180deg, #D4AF37, #C9956B);
        clip-path: polygon(50% 0%, 100% 20%, 100% 70%, 50% 100%, 0% 70%, 0% 20%);
        opacity: 0.03;
        z-index: 0;
    }
    .cta-layout {
        display: flex;
        align-items: center;
        height: 920px;
        position: relative;
    }
    .cta-profile-cutout {
        position: absolute;
        left: -40px;
        bottom: 10px;
        width: 540px;
        z-index: 10;
    }
    .cta-profile-cutout img {
        width: 100%;
        height: auto;
    }
    .cta-right {
        margin-left: 450px;
        z-index: 2;
        max-width: 540px;
    }
    .cta-right h2 {
        font-size: 38px;
        line-height: 1.45;
        margin-bottom: 24px;
        font-weight: 900;
        letter-spacing: -1.5px;
    }
    .cta-right .sub-msg {
        font-size: 24px;
        color: #A0B4C8;
        margin-bottom: 36px;
        line-height: 1.75;
        letter-spacing: 0.3px;
    }
    .cta-contact-box {
        background: rgba(255,255,255,0.06);
        border: 1px solid rgba(212,175,55,0.20);
        border-radius: 16px;
        padding: 28px 36px;
        backdrop-filter: blur(12px);
        -webkit-backdrop-filter: blur(12px);
    }
    .cta-name {
        font-size: 22px; color: #A0B4C8; margin-bottom: 16px;
    }
    .cta-phone-btn {
        display: inline-flex; align-items: center; gap: 12px;
        background: linear-gradient(135deg, rgba(212,175,55,0.15), rgba(212,175,55,0.08));
        border: 1px solid rgba(212,175,55,0.30);
        border-radius: 12px;
        padding: 16px 28px;
        margin-bottom: 12px;
    }
    .cta-phone-btn span {
        font-size: 30px; font-weight: 900; color: #D4AF37;
        letter-spacing: 1px;
    }
    .phone-icon {
        font-size: 24px !important;
    }
    .cta-handle {
        font-size: 18px; color: #C9956B;
        font-weight: 600;
    }
    .cta-center {
        width: 100%;
        text-align: center;
        margin-top: 160px;
    }
    .cta-center h2 {
        font-size: 42px;
        line-height: 1.45;
        margin-bottom: 28px;
        font-weight: 900;
        letter-spacing: -1.5px;
    }
    .cta-center .sub-msg {
        font-size: 22px;
        color: #A0B4C8;
        margin-bottom: 48px;
        line-height: 1.75;
    }
    .cta-contact-box-center {
        background: rgba(255,255,255,0.06);
        border: 1px solid rgba(212,175,55,0.20);
        border-radius: 16px;
        padding: 32px 48px;
        display: inline-block;
        backdrop-filter: blur(12px);
        -webkit-backdrop-filter: blur(12px);
    }
    .cta-contact-box-center .cta-name { font-size: 22px; color: #A0B4C8; margin-bottom: 16px; }
    .cta-contact-box-center .cta-phone-btn { margin-bottom: 12px; }
    .cta-contact-box-center .cta-handle { font-size: 20px; color: #C9956B; }
    </style></head><body>
